import React ,{Component}from 'react';
import Build from "views/Icons/Table"

import Button from "components/CustomButtons/Button.jsx";
/*function WarningBanner(props) {
  if (!props.warn) {
    return null;
  }

  return (
    <div className="warning">
      <h1> Warning! </h1>
    </div>
  );
}*/

function WarningBanner(props) {
    return (
      <div className={props.warn ? "warning": "hide"}>
        <h1> Warning! </h1>
      </div>
    );
  }
  
 export default class Page extends React.Component {
    constructor(props) {
      super(props);
      this.state = {data: []}
      this.handleToggleClick = this.handleToggleClick.bind(this);
      this.handleToggleClick1 = this.handleToggleClick1.bind(this);

    }
  
    handleToggleClick=(e)=> {
        e.preventDefault();
        window.location.assign('/admin/Students/');
    }
    handleToggleClick1=(e)=> {
        e.preventDefault();
        window.location.assign('/admin/Grades/');
    }
  
    render() {
        const style=this.state.showWarning ?{display:'none'}:{};
      return (
        <div >
          {
            this.state.data.map((row,i)=>(
              <div> 
              <a href="http://localhost:3000/admin/Classes?={row.level}">{row.level}
         
         <Button type="submit" color={"warning"} onClick={this.handleToggleClick} >veiw student </Button>
         <Button type="submit" color={"warning"} onClick={this.handleToggleClick1} >create exam and add Grade </Button>
         <Button type="submit" color={"warning"} onClick={this.handleToggleClick2} >add attendance </Button>
         <Button type="submit" color={"warning"} onClick={this.handleToggleClick3} >add attendance </Button>
         <Button type="submit" color={"warning"} onClick={this.handleToggleClick4} >show activity </Button>
         </a>
         </div>
         ))
        }

        </div>
      );
    }
  }
